INSERT INTO `actividades` (`id`, `nombre`, `imagen`, `imagen1`, `imagen2`, `imagen3`, `imagen4`, `imagen5`, `descripcion`, `fecha`) VALUES
(4, 'Jornada de Sensibilización Estudiantes', , , , '', '', '', 'Es una estrategia de acercamiento inicial a estudiantes y docentes de la universidad tecnológica del chocó a través de la cual se les da a conocer las políticas y acuerdos que sustentan el quehacer entorno al emprendimiento adoptado por la universidad y liderado por el centro, así como los servicios y ofertas de cursos cortos, horarios de atención y disponibilidad del personal docente para acompañamiento y asesoría.\r\n1. Acercamiento a los salones previamente identificados para dar a conocer lo siguiente y procesos de sensibilización:\r\n\r\nQuienes somos: El CEIUTCH, es una unidad administrativa de servicios, adscrita a la Rectoría de la UTCH\r\nQue hacemos: El CEIUTCH, se encarga de ofrecer a todos los estudiantes, egresados, docentes, administrativos y comunidad en general. Programas de:\r\nFormación y Capacitación Empresarial\r\nAsesoramiento y acompañamiento en proyectos empresariales\r\nAsesoramiento en presentación a convocatorias para capital semilla\r\nGestión y desarrollo empresarial.\r\nInvestigación (semillero)\r\nBúsqueda de Financiación para proyectos.\r\nEspacio de interacción y sinergia entre emprendedores de la región (Club de emprendedores, red de emprendimiento)\r\nDonde estamos: El CEIUTCH, está ubicada en la ciudadela Universitaria, bloque 8, piso 3, oficinas 316 y 318\r\nQue buscamos: El CEIUTCH, busca; Generar conocimiento sobre emprendimiento e Incentivar el emprendimiento como un estilo de vida Apoyar a los emprendedores en el desarrollo de sus iniciativas y proyectos empresariales\r\nFomentar la sostenibilidad de nuevas empresas\r\nEquipo de trabajo: Contamos con un equipo multidisciplinario, integrado por 12 profesionales en distintas especialidades, para el asesoramiento integral en todas las áreas funcionales de la empresa y en todas las etapas de un proyecto.\r\nHorario de atención: lunes a viernes de 8:00 am. A 12:00 m. y de 2:00 pm. A 6:00 pm.', '2024-07-26 05:18:05');
