(5, 'Programa radial', , '', '', '', '', '', 'La hora del emprendimiento es un programa radial que esta al aire todos los jueves de 10:00–11:00 am por la emisora radio universidad del Choco 97.3 FM, y nace por iniciativa del centro de emprendimiento e innovación de la Universidad Tecnológica del Choco “Diego Luis Córdoba” con el propósito de promover e incentivar la cultura de emprendimiento en la comunidad en general y destacar actividades y eventos promovidos por emprendedores de la región.', '2024-07-26 05:23:17');

